import React from 'react';

function Footer() {
    return(
        <footer>
            <h2 class="f-title">サロン名</h2>
            <nav class="f-nav">
                <ul class="f-ul">
                    <li class="f-li"><a href="#">TOP</a></li>
                    <li class="f-li"><a href="#">会社情報</a></li>
                    <li class="f-li"><a href="#">新着情報</a></li>
                    <li class="f-li"><a href="#">お問い合わせ</a></li>
                </ul>
            </nav>

        </footer>
    );
}

export default Footer;
